import React from 'react';
import techImg from '../img/TechProducts.jpg';
import commercialImg from '../img/CommercialProducts.png';
import kitchenImg from '../img/kitchenproducts.png';
import printImg from '../img/PrinInDemand.png';

function Categories() {
  const items = ['Tech Products', 'Commercial & Official', 'Kitchen Products', 'Print-On-Demand'];
  return (
    <section>
      <h2>Featured Collections</h2>
      <div style={{ display: 'flex', flexWrap: 'wrap' }}>
        {items.map((item, i) => (
          <button key={i}>{item}</button>
        ))}
      </div>
    </section>
  );
}

export default Categories;
